import '../App.css';
import React from 'react';

class LinkCustomization extends React.Component {
    render() {
        return(
            <div style={{textAlign: 'left'}}>
                <div style={{backgroundColor: '#30363D', padding: '10px', borderRadius: '7px'}}>
                    <div style={{textAlign: 'left', margin: '0px 10px 0px 0px', display: 'flex'}}>
                        <p style={{float: 'left', color: 'white'}}>Add Link Tile</p>
                        <input type="text" style={{width: '70px'}}></input>
                    </div>
                    {this.props.tiles.map((tile) => {
                        return(
                            <div>
                                <p>{tile.name}</p>
                            </div>
                        )
                    })}
                </div>
            </div>
        )
    }
}

export default LinkCustomization;
